// import ReactDOM from "react-dom";
import { render } from "@testing-library/react";

const StyleDiv = styled.div`
background-color: #f2f2f2;
border-radius: 6px;
width: 60%;
margin : auto;
border:  1px solid #eee;
box-shadow: 0 2px 3px #ccc;
padding: 16px;
margin-bottom:15px;
margin-top: 15px; 
text-align: center;

@media(min-width : 500px){
        width: 450px;
}
`


const person = (props) => {
    // const style = {
    //     '@media(min-width : 500px)':{
    //         width : '450px'
    //     }
    // }
render()
    return (
<StyleDiv>
    <p onClick={props.click}>My Own React Component and my name is {props.name} & My Age is {props.age} i am {Math.floor(Math.random() * 30 )} Year Old </p>
    
    <p>{props.children}</p>
    <input type="text" onChange ={props.changed} value={props.name} />
        </StyleDiv>
    )
}

export default person;
